import React, { Component } from 'react'
import { Redirect } from 'react-router'
export default class PassOrder extends Component {
   
    render() {
        
        return (
            <div>
              <button>  
                <Redirect to='/createorder' props={this.props}>
                    Сформировать заказ</Redirect>
               </button>


            </div>
        )
    }
}
